import "./styles.css";
import Pokemon from "../Pokemon";

const Modal = ({ pokemon, selected }) => {
  return (
    <div className="modal">
      <div className="card">
        <div className="image-container">
          <img src={pokemon.img} alt="Pokemon" />
        </div>
      </div>
    </div>
  );
};

export default Modal;
